import React from 'react'

const video_list_item = ({video}) => {
    return (
        <li className="list-group-item">
            <div className="video-list media">
                <div className="media-left">
                <img className="media-object"/>
                </div>
            </div>
        </li>
    )
}

export default video_list_item
